    public String minRemoveToMakeValid(String s) {

        Stack<Pair<Character, Integer>> st = new Stack<>();

        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == '(' || s.charAt(i) == ')') {
                if (s.charAt(i) == ')') {
                    if (!st.isEmpty() && st.peek().getKey() == '(') {
                        st.pop();
                        //continue;
                    } else {
                        Pair<Character, Integer> p = new Pair(')', i);
                        st.push(p);
                    }
                } else {
                    Pair<Character, Integer> p = new Pair('(', i);
                    st.push(p);
                }

            }
        }

        if (st.isEmpty()) {
            return s;
        }

        Set<Integer> set = new HashSet<>();

        while (!st.isEmpty()) {
            set.add(st.pop().getValue());
        }

        StringBuilder sb = new StringBuilder("");
        for (int i = 0; i < s.length(); i++) {
            if (!set.contains(i)) {
                //st.pop();
                //continue;
                //sb = sb + s.charAt(i);
                sb.append(s.charAt(i));
            }
            //ans = ans + s.charAt(i);
        }
//        StringBuilder sb = new StringBuilder(ans);
//        ans = sb.reverse().toString();
        return sb.toString();
    }

    public String removeDuplicates(String s, int k) {
        StringBuilder ans = new StringBuilder();

        if (k == 1) {
            return "";
        }

        Stack<Pair<Character, Integer>> st = new Stack<>();

        for (int i = 0; i < s.length(); i++) {
            if (!st.isEmpty() && st.peek().getKey() == s.charAt(i)) {
                Pair<Character, Integer> p = st.pop();
                int count = p.getValue() + 1;
                if (count < k) {
                    p = new Pair<>(s.charAt(i), count);
                    st.push(p);
                }
            } else {
                Pair<Character, Integer> p = new Pair<>(s.charAt(i), 1);
                st.push(p);
            }
        }

        while (!st.isEmpty()) {
            int count = st.peek().getValue();
            char c = st.peek().getKey();
            st.pop();
            while (count != 0) {
                count--;
                ans.append(c);
            }
        }

        return ans.reverse().toString();
    }

    public int getLength(ListNode head) {
        int len = 0;
        while (head != null) {
            len++;
            head = head.next;
        }
        return len;
    }

    public int[] nextLargerNodes(ListNode head) {

        int len = getLength(head);
        int[] ans = new int[len];
        Stack<StackNode> st = new Stack<>();

        for (int i = 0; i < len; i++) {

            if (!st.isEmpty()) {

                while (!st.isEmpty() && st.peek().node.val < head.val) {
                    ans[st.pop().index] = head.val;
                    //st.pop();
                }
            }
            StackNode sn = new StackNode(i, head);
            st.push(sn);
            head = head.next;
        }

        while (!st.isEmpty()) {
            ans[st.peek().index] = 0;
            st.pop();
        }

        return ans;
    }
    public int minAddToMakeValid(String s) {
        
        Stack<Character> st = new Stack<>();

        for (int i = 0; i < s.length(); i++) {
            if(s.charAt(i) == ')')
            {
                if(st.peek() == '(')
                {
                    st.pop();
                    continue;
                }
            }
            st.push(s.charAt(i));
        }

        return st.size();
        
    }
    
